import React from "react";
import { ReactDOM } from "react-dom";
import Card from "./Card";
export default function DynamicContent(products){
    let productsCards = [];
    for(let i = 0 ; i < products.length();i++){
     productsCards.push(Card(products[i]));
    }
}
